} message Pong { // primitive serviceProvider.id bytes serviceProvider = 1; // the location where the services are provided - specified by the industry implementation bytes loc = 2; // timestamp when the pong was sent. google.protobuf.Timestamp timestamp = 3; // signature of a bidder signer for the service provider, verifiable on-chain bytes signature = 4;
