Content topics 'what' : bid, ask message AskWrapper { // random salt used to target bid bytes salt = 1; // the payload (ask) from the consumer to the service providers bytes payload = 2;
} message BidWrapper { // primitive serviceProvider.id bytes serviceProvider = 1; // keccak(AskWrapper.salt & AskWrapper.payload) for response filtering bytes askDigest = 2; // the payload (bid) from the service provider to the consumer bytes payload = 3; // bidder signs hash of fields (1,2,3) bytes signature = 4;
} message BidTerm { // primitive term.id - terms by which the service is subject to bytes term = 1; // the contract address implementing ITerm bytes impl = 2; // abi encoded payload that may be passed to a contract implementing ITerm optional bytes txPayload = 3;
} // an optional item is an item that comes with an additional cost
message BidOptionItem { bytes item = 1; repeated videre.type.ERC20Native cost = 2; // bidder signs hash of fields (1, 2, askDigest) bytes signature = 3;
} // an optional term is a term that comes with an additional cost
message BidOptionTerm { BidTerm term = 1; repeated videre.type.ERC20Native cost = 2; // bidder signs hash of fields (1, 2, askDigest) bytes signature = 3;
} message BidOptions { // optional items and/or terms that may be purchased repeated BidOptionItem items = 1; repeated BidOptionTerm terms = 2;
} message BidLine { // the item(s) offered in a bundled state, ie. space + breakfast repeated bytes items = 1; // the term(s) offered in a bundled state, ie. fully flexible + no cancellation repeated BidTerm terms = 2; // the option(s) offered, ie. add breakfast, add fully-flexible BidOptions options = 3; // the maximum number of times this bid authorisation can be used uint32 limit = 4; // the latest timestamp at which this bid is valid uint32 expiry = 5; // the cost in specified tokens or native unit of account // TODO: expand to detailed cost structure repeated videre.type.ERC20Native cost = 6; // include the capabilities for negative costs // bidder signs hash (AskWrapper.salt, limit, expiry, serviceProvider (which), askDigest (params), items, terms, options, cost) bytes signature = 7;
} message Bids { // bids that match the ask repeated BidLine bids = 1;
} AskWrapper.payload is defined as bytes to allow a generic, industry-agnostic bid / ask protocol to be defined. Specific ask parameters are defined in industry-specific protocol implementations of Videre. BidWrapper.payload is defined as bytes for possible future expansion to industry-specific bid replies.

